import React, { useState } from "react";
import { Button, StyleSheet, Text, View, Image } from "react-native";
import { stylesNw } from "./AppCSS";
import { ScrollView } from "react-native-gesture-handler";

export default function App() {
  return (
    <ScrollView style={stylesNw.container}>
      <View style={stylesNw.cardProduto}>
        <Image
          source={{
            uri: "https://img.migalhas.com.br/gf_base/empresas/MIGA/imagens/375A16BA62969085D0338E65C57C729E0860_churrasco.jpg",
          }}
        />
      </View>
    </ScrollView>
  );
}
